import base64
from typing import List

# BOF imports
from core.gunnershell.bofs.base import Bof, register

from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("domaininfo")
class DomainInfoBof(Bof):
	base64bof: str = ""
	x86base64bof: str = ""

	def help_menu():
		menu = """
domaininfo — Domain/forest functional levels + FSMO owners (flag-based)

SYNOPSIS
  bofexec domaininfo [FLAGS]

DESCRIPTION
  Queries Active Directory for:
    • Domain, forest, and DC functional levels
    • All five FSMO role owners (Schema, Domain Naming, PDC, RID, Infrastructure)
  This module accepts flags in the form `--keyword value`. All flag parsing and
  argument packing is done server-side; the BOF itself does not parse argv.

FLAGS
  Connection / Auth
    --host VALUE               Target DC (FQDN/IP). Omit or "" to auto/DC locator.
    --port INT                 389 (LDAP) or 636 (LDAPS). If omitted, chosen by --ldaps.
    --ldaps 0|1                Use LDAPS (SSL/TLS + 636). Default: 0 (off).
    --starttls 0|1             StartTLS upgrade on plain LDAP. Ignored if --ldaps=1. Default: 0.
    --auth negotiate|simple|0|1
                               Authentication mode. negotiate/0 = current logon token (default).
                               simple/1 = simple bind (uses --user/--pass/--domain).
    --user VALUE               Username for simple bind. Omit/"" when using negotiate.
    --pass VALUE               Password for simple bind.
    --domain VALUE             If --user has no '@' and --domain is set, server packs USER@DOMAIN.
    --timeout-ms INT           LDAP time limit (server may round to seconds). 0 = library default.
    --referrals 0|1            Follow LDAP referrals. Default: 0 (off).

  What to Query
    --do-levels 0|1            Query domain/forest/DC functional levels. Default: 1.
    --do-fsmo 0|1              Resolve FSMO role owners. Default: 1.

  FSMO Resolution
    --resolve-mode INT         How to print each FSMO owner (Default: 4):
                                 0 = raw fSMORoleOwner DN
                                 1 = server CN
                                 2 = dNSHostName
                                 3 = host + site
                                 4 = host + site + OS
    --include-dn 0|1           Also print the raw owner DN alongside resolved output. Default: 1.

  Level Formatting
    --include-friendly 0|1     Include friendly names (e.g., “Windows Server 2016”). Default: 1.
    --include-numeric 0|1      Include numeric level codes (e.g., 7). Default: 1.

  Naming Context Overrides (advanced; wide strings)
    --override-default-nc VALUE    Override defaultNamingContext. Use "" to skip.
    --override-config-nc  VALUE    Override configurationNamingContext. Use "" to skip.
    --override-schema-nc  VALUE    Override schemaNamingContext. Use "" to skip.

  Output / UX
    --output pretty|kv|csv|json|0|1|2|3
                               Output mode. pretty/0 (human), kv/1 (key=value),
                               csv/2, json/3 (minimal JSON-like). Default: pretty.
    --quiet 0|1                Suppress section titles in pretty mode. Default: 0.
    --debug 0|1                Reserved; minimal diagnostics. Default: 0.

EXAMPLES
  # Auto-bind (Negotiate) to discovered DC over LDAP; print everything nicely:
  bofexec domain_info --do-levels 1 --do-fsmo 1 --resolve-mode 4 --include-dn 1 --output pretty

  # Target dc01 via LDAPS:636 with 5s limit, follow referrals, CSV output, include raw DNs:
  bofexec domain_info --host dc01.corp.local --ldaps 1 --port 636 --timeout-ms 5000 \
                      --referrals 1 --do-levels 1 --do-fsmo 1 --resolve-mode 3 \
                      --include-dn 1 --output csv

  # Simple bind on dc02, FSMO only, kv output, resolve to dNSHostName:
  bofexec domain_info --host dc02.corp.local --auth simple --user svc_reader \
                      --pass P@ssw0rd! --domain corp.local \
                      --do-levels 0 --do-fsmo 1 --resolve-mode 2 --output kv --quiet 1

OUTPUT MODES
  pretty    Human-friendly report (titles optional).
  kv        One item per line: key=value (easy to parse server-side).
  csv       Emits “metric,value” for levels and a CSV row per FSMO role.
  json-lite Minimal JSON object/rows; not strict JSON escaping for all values.

RESOLUTION MODES
  0 Raw DN         Example: CN=NTDS Settings,CN=DC01,…
  1 Server CN      Example: DC01
  2 Hostname       Example: dc01.corp.local
  3 Host+Site      Example: Host line + “Site: Default-First-Site-Name”
  4 Host+Site+OS   Adds “OS: Windows Server 2019; 10.0.17763” when resolvable

NOTES
  • All flags are optional; defaults shown above. Boolean flags accept 0/1.
  • `--starttls` is ignored when `--ldaps=1`.
  • Functional level “2016 (or later)” is reported as 7 on newer AD (2019/2022).
  • This help reflects the flag interface; server-side code must translate flags
    into the packed Beacon argument blob expected by the BOF.
"""
		print(brightgreen + menu + reset)
		return

	@staticmethod
	def args_inject(p):
		# Connection / Auth
		p.add_argument("--host", default="", help="Target DC (FQDN/IP). Empty = auto/DC locator")
		p.add_argument("--port", type=int, default=0, help="LDAP port (0=auto; 389/636)")
		p.add_argument("--ldaps", type=int, choices=(0, 1), default=0, help="Use LDAPS (0/1)")
		p.add_argument("--starttls", type=int, choices=(0, 1), default=0, help="Upgrade to StartTLS (0/1)")
		p.add_argument("--auth", default="negotiate", help="Auth mode: negotiate|simple|0|1")
		p.add_argument("--user", default="", help="Username for simple bind")
		p.add_argument("--pass", dest="password", default="", help="Password for simple bind")
		p.add_argument("--domain", default="", help="Domain suffix when USER lacks '@'")
		p.add_argument("--timeout-ms", type=int, default=0, help="LDAP time limit in ms (0=default)")
		p.add_argument("--referrals", type=int, choices=(0, 1), default=0, help="Follow referrals (0/1)")

		# What to query
		p.add_argument("--do-levels", type=int, choices=(0, 1), default=1, help="Query functional levels (0/1)")
		p.add_argument("--do-fsmo", type=int, choices=(0, 1), default=1, help="Query FSMO owners (0/1)")

		# FSMO resolution / formatting
		p.add_argument("--resolve-mode", type=int, choices=(0, 1, 2, 3, 4), default=4,
			help="0=DN 1=CN 2=host 3=host+site 4=host+site+OS")
		p.add_argument("--include-dn", type=int, choices=(0, 1), default=1, help="Include raw fSMORoleOwner DN (0/1)")

		# Level formatting
		p.add_argument("--include-friendly", type=int, choices=(0, 1), default=1,
			help="Include friendly names (e.g., 'Windows Server 2016')")
		p.add_argument("--include-numeric", type=int, choices=(0, 1), default=1,
			help="Include numeric level codes")

		# Naming context overrides (treated as wide strings on the wire)
		p.add_argument("--override-default-nc", default="", help="Override defaultNamingContext (wide)")
		p.add_argument("--override-config-nc", default="", help="Override configurationNamingContext (wide)")
		p.add_argument("--override-schema-nc", default="", help="Override schemaNamingContext (wide)")

		# Output / UX
		p.add_argument("--output", default="pretty", help="pretty|kv|csv|json or 0|1|2|3")
		p.add_argument("--quiet", type=int, choices=(0, 1), default=0, help="Suppress titles in pretty mode (0/1)")
		p.add_argument("--debug", type=int, choices=(0, 1), default=0, help="Reserved (0/1)")
		return

	@staticmethod
	def build_remote_args(ns):
		"""
		Pack into (exact order expected by BOF):
		  1  -z: host
		  2  -i: port
		  3  -i: ldaps
		  4  -i: starttls
		  5  -i: auth (0=negotiate,1=simple)
		  6  -z: user
		  7  -z: pass
		  8  -z: domain
		  9  -i: timeout_ms
		 10  -i: referrals
		 11  -i: do_levels
		 12  -i: do_fsmo
		 13  -i: resolve_mode
		 14  -i: include_dn
		 15  -i: include_friendly
		 16  -i: include_numeric
		 17  -Z: override_default_nc
		 18  -Z: override_config_nc
		 19  -Z: override_schema_nc
		 20  -i: output_mode (0=pretty,1=kv,2=csv,3=json)
		 21  -i: quiet
		 22  -i: debug

		Token types:
		  -z: char*, -Z: wide char*, -i: 32-bit int, -s: 16-bit int (unused here)
		"""
		# Normalize + map
		host = getattr(ns, "host", "") or ""
		port = int(getattr(ns, "port", 0) or 0)
		ldaps = 1 if getattr(ns, "ldaps", 0) else 0
		starttls = 1 if getattr(ns, "starttls", 0) else 0

		auth_raw = (getattr(ns, "auth", "negotiate") or "negotiate").strip().lower()
		auth = 1 if auth_raw in ("1", "simple") else 0

		user = getattr(ns, "user", "") or ""
		password = getattr(ns, "password", "") or ""
		domain = getattr(ns, "domain", "") or ""

		timeout_ms = int(getattr(ns, "timeout_ms", 0) or 0)
		referrals = 1 if getattr(ns, "referrals", 0) else 0
		do_levels = 1 if getattr(ns, "do_levels", 1) else 0
		do_fsmo = 1 if getattr(ns, "do_fsmo", 1) else 0
		resolve_mode = int(getattr(ns, "resolve_mode", 4))
		include_dn = 1 if getattr(ns, "include_dn", 1) else 0
		include_friendly = 1 if getattr(ns, "include_friendly", 1) else 0
		include_numeric = 1 if getattr(ns, "include_numeric", 1) else 0

		ov_def = getattr(ns, "override_default_nc", "") or ""
		ov_cfg = getattr(ns, "override_config_nc", "") or ""
		ov_sch = getattr(ns, "override_schema_nc", "") or ""

		out_raw = str(getattr(ns, "output", "pretty")).strip().lower()
		out_map = {"pretty": 0, "kv": 1, "csv": 2, "json": 3, "0": 0, "1": 1, "2": 2, "3": 3}
		output_mode = out_map.get(out_raw, 0)

		quiet = 1 if getattr(ns, "quiet", 0) else 0
		debug = 1 if getattr(ns, "debug", 0) else 0

		return [
			f"-z:{host}",
			f"-i:{port}",
			f"-i:{ldaps}",
			f"-i:{starttls}",
			f"-i:{auth}",
			f"-z:{user}",
			f"-z:{password}",
			f"-z:{domain}",
			f"-i:{timeout_ms}",
			f"-i:{referrals}",
			f"-i:{do_levels}",
			f"-i:{do_fsmo}",
			f"-i:{resolve_mode}",
			f"-i:{include_dn}",
			f"-i:{include_friendly}",
			f"-i:{include_numeric}",
			f"-Z:{ov_def}",
			f"-Z:{ov_cfg}",
			f"-Z:{ov_sch}",
			f"-i:{output_mode}",
			f"-i:{quiet}",
			f"-i:{debug}",
		]